properties.SPARQL_CONSTRUCT_QUERY:
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX sosa: <http://www.w3.org/ns/sosa/>
PREFIX ngsiLdDC: <https://uri.etsi.org/ngsi-ld/default-context/>
PREFIX ngsiLd: <https://uri.etsi.org/ngsi-ld/>
CONSTRUCT {
    ?device rdf:type ngsiLdDC:Device .
	?device ngsiLdDC:dateLastValueReported [
		rdf:type ngsiLd:Property ;
		ngsiLd:hasValue ?dateObserved
	].
} WHERE {
    ?wqo rdf:type ngsiLdDC:WaterQualityObserved .
    ?wqo ngsiLdDC:dateObserved [
        ngsiLd:hasValue ?dateObserved
    ] .
    ?wqo ngsiLdDC:refDevice [
		ngsiLd:hasObject ?device
	] .
}
